import React, { useEffect, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Navbar = () => {
  const navigate = useNavigate();
  const [utente, setUtente] = useState(null);
  const [showMenu, setShowMenu] = useState(false);
  const [showLogoutModal, setShowLogoutModal] = useState(false);
  const [temaScuro, setTemaScuro] = useState(false);

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) return;

    try {
      const payload = JSON.parse(atob(token.split('.')[1]));
      setUtente({
        nome: payload.nome || payload.email,
        ruolo: payload.ruolo
      });
    } catch (err) {
      console.error('Errore decoding token:', err);
      setUtente(null);
    }
  }, []);

  const logout = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  const toggleTema = () => {
    setTemaScuro(!temaScuro);
    document.body.style.backgroundColor = !temaScuro ? '#222' : '#fff';
    document.body.style.color = !temaScuro ? '#fff' : '#000';
  };

  const isCommittente = utente?.ruolo === 'committente';
  const isImpresa = utente?.ruolo === 'impresa';
  const isProfessionista = utente?.ruolo === 'professionista';

  return (
    <nav style={{
      padding: '1rem',
      background: temaScuro ? '#333' : '#eee',
      color: temaScuro ? '#fff' : '#000',
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center'
    }}>
      <div>
        <Link to="/">🏠 Home</Link>{' | '}
        <Link to="/richieste-lavoro-in-quota">🔍 Richieste di lavoro in quota</Link>{' | '}

        {utente && (
          <>
            <Link to="/home">Dashboard</Link>{' | '}

            {isCommittente && (
              <>
                <Link to="/mie-richieste">Le mie richieste</Link>{' | '}
                <Link to="/nuova-richiesta">Nuova richiesta</Link>{' | '}
              </>
            )}

            {(isImpresa || isProfessionista) && (
              <>
                <Link to="/sblocchi-effettuati">Sblocchi effettuati</Link>{' | '}
              </>
            )}
          </>
        )}
      </div>

      <div style={{ display: 'flex', alignItems: 'center', gap: '1rem' }}>
        <button onClick={toggleTema}>
          {temaScuro ? '🌙 Scuro' : '🌞 Chiaro'}
        </button>

        {utente ? (
          <div style={{ position: 'relative' }}>
            <span
              onClick={() => setShowMenu(!showMenu)}
              style={{ cursor: 'pointer', fontWeight: 'bold' }}
            >
              👋 Benvenuto, {utente.nome} ({utente.ruolo})
            </span>

            {showMenu && (
              <div style={{
                position: 'absolute',
                right: 0,
                backgroundColor: temaScuro ? '#444' : '#fff',
                border: '1px solid #ccc',
                padding: '0.5rem',
                marginTop: '0.5rem',
                zIndex: 1000
              }}>
                <button onClick={() => setShowLogoutModal(true)} style={{ color: 'red' }}>
                  🔓 Logout
                </button>
              </div>
            )}
          </div>
        ) : (
          <Link to="/login">🔐 Login</Link>
        )}
      </div>

      {showLogoutModal && (
        <div style={{
          position: 'fixed', top: 0, left: 0, width: '100%', height: '100%',
          background: 'rgba(0,0,0,0.6)', display: 'flex', justifyContent: 'center', alignItems: 'center',
          zIndex: 999
        }}>
          <div style={{
            background: '#fff', padding: '2rem', borderRadius: '8px', textAlign: 'center'
          }}>
            <p>Sei sicuro di voler uscire?</p>
            <button onClick={logout} style={{ marginRight: '1rem' }}>Sì, esci</button>
            <button onClick={() => setShowLogoutModal(false)}>Annulla</button>
          </div>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
